import React from 'react';

var imageInfoBlock = {
    height: '30vw',
    display: 'flex',
}

var imgBl = {

}

var img = {

}

var textBl = {

}

var headerContBlock = {

}

var textContBlock = {

}

function ImageInfoBlock(props) {

    if(props.isDark) {
        imageInfoBlock = {...imageInfoBlock, background: 'rgba(44,42,41)', color: 'white'}
    }



    return (
        <div style={ imageInfoBlock } className="imageInfoBlock">
            <div style={ imgBl }> 
                <img src={ props.image } alt={props.headding} style={ img } />
            </div>
            <div style={ textBl }>
                <div style={headerContBlock}>
                    {props.headerContent}
                </div>
                <div style={textContBlock}>
                    {props.textContent}
                </div>
            </div>
        </div>
    );
}

export default ImageInfoBlock;
